import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import InvoiceGenerator from './InvoiceGenerator';
import PreviousBills from './PreviousBills';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/generate-invoice" component={InvoiceGenerator} />
        <Route path="/previous-bills" component={PreviousBills} />
        <Route exact path="/" component={InvoiceGenerator} />
      </Switch>
    </Router>
  );
};

export default App;
